import { React } from "react";
import { InsertData } from '../../services/InsertData';

export function get_costumes(state, data) {
    InsertData('costumes', state).then((result) => {
        let responseJson = result;            
        if(responseJson.costumeData){
           sessionStorage.setItem("costumes",JSON.stringify(responseJson));
           data = responseJson.costumeData; 
        }
        else{
            alert(result.error);
        }
        });
}
